+    {
+        try {
+            $tempPdfPath = tempnam(sys_get_temp_dir(), 'pdf_') . '.pdf';
+            file_put_contents($tempPdfPath, $pdfContent);
+
+            $parser = new PdfParser;
+            $pdf = $parser->parseFile($tempPdfPath);
