+
+        if ($fieldName === 'Producer Name') {
+            if (preg_match('/Producer\s+Name\s*:\s*\n\s*([^\n]+(?:\n[^\n:]+)*?)(?=\n\s*(?:Wastes Location|Trade License|Mobile|Email|Company Name|Part \d+|$))/is', $content, $matches)) {
